fil["21"]= "level_3_1.html@@@Level 3@@@Eine Interpretation von Graphen wird vollständig unterlassen . Der Graph wird als ein Codepoint unter Nutzung von standardisierten Kodierungen (Unicode), communitynormierten Kodierungen (MUFI) und...";
