fil["23"]= "lyAbsatz.html@@@Absatz (paragraph)@@@Einzelne zusammenhängende Textregionen werden als Absatz ausgezeichnet. Initialen und Marginalien, Tabellen, Überschriften, Kolumnentitel, Bildunterschriften, Fuß- und Endnoten sowie Seitenzählung...";
fil["24"]= "lyAllgemein.html@@@Allgemeines@@@Strukturell betrachtet besteht ein Buch aus verschiedenen Seitentypen und auf den Seiten befinden sich verschiedene strukturell sowie inhaltlich unterschiedliche Regionen. Vor allem die TextRegion...";
fil["25"]= "lyBildbereiche.html@@@Abbildungen, Fotos (ImageRegion)@@@Mit einer ImageRegion wird eine Abbildung, die eine fotografische Aufnahme, ein Gemälde oder eine Zeichnung sein kann, ausgezeichnet. Abbildung: Beispiel für ImageRegion: Abbildung von einzelnen...";
fil["26"]= "lyBogensignatur.html@@@Bogensignatur (signature-mark)@@@Bogensignaturen befinden sich wie Kustoden unterhalb des Satzspiegels. Sie bezeichnen den Bogen oder die Lage im Buch und dienen somit dem Buchbinder als Vorgabe für die Realisierung der korrekten...";
fil["27"]= "lyChemische_Symbole.html@@@Chemische Symbole (ChemRegion)@@@Chemische Zeichen und Formeln sind nicht als Textregionen, sondern als Region „Chemische Symbole“ zu kennzeichnen. Einzelne Zeichen, die in Reaktionsgleichungen oder dergleichen lesbar sind, werden...";
fil["28"]= "lyDiskontinuierlich.html@@@Schwimmende Elemente im Satzspiegel (floating)@@@Es kann vorkommen (bei Alten Drucken eher selten), dass Abbildungen oder Erläuterungen nicht an der sachlich korrekten Stelle gesetzt wurden, an der sie referenziert werden, sondern den Text an...";
fil["29"]= "lyFussnote.html@@@Fußnote (footnote / footnote-continued / endnote)@@@Fußnoten erscheinen im unteren Seitenbereich des Satzspiegels (zuweilen auch außerhalb). Zumeist bilden sie die letzte gedruckte Passage auf der Seite. Nur Bogensignaturen werden üblicherweise noch...";
fil["30"]= "lyGraphik.html@@@Buchschmuck, Zeichnungen (GraphicRegion)@@@Mit einer graphicRegion werden u. a. einfache Graphiken, handschriftliche Anmerkungen sowie Lochungen ausgezeichnet. Folgendes wird unter einer einfachen Graphik verstanden: ein Logo (logo) ein...";
fil["31"]= "lyInhaltsverzeichnis.html@@@Inhaltsverzeichnis (TOC-entry)@@@Spezielles Layout besitzen Inhaltsverzeichnisse (PageTypeSimpleType table-of-contens ), die meist am Anfang oder Ende des Werkes erscheinen und i. d. R. eine formale Überschrift besitzen. Während...";
fil["32"]= "lyInitiale.html@@@Initiale (drop-capital)@@@Initialen werden als spezielle Textregion ausgezeichnet. Das gilt auch dann, wenn sie stark graphisch verfremdet wurden. Sie erstrecken sich meistens über mehrere Zeilen und es ist überwiegend der...";
fil["33"]= "lyKolumnentitel.html@@@Kolumnentitel (header)@@@In Zusammenhang mit der Ground-Truth-Erstellung sind unter dem Kolumnentitel „Kurztitelfassungen“ der Kapitel-, Unterkapitelüberschriften, die zur Orientierung im Buch dienen, v. a. im Kopfsteg über...";
fil["34"]= "lyKustode.html@@@Kustode (catch-word)@@@Kustoden sind Wörter bzw. Silben im unteren rechten Seitenbereich, die das für den Textfluss notwendige nächste Wort bzw. die nächste Silbe vorweg anzeigen. Sie erscheinen rechtsbündig und im Falle...";
fil["35"]= "lyLeserichtung.html@@@Leserichtung@@@Um inhaltliche und formale Zusammenhänge nicht zu zerreißen, werden einzelne Seitenelemente gruppiert. Für eine solche Gruppierung kann in der Regel eine Leserrichtung vorgegeben werden; handelt es...";
fil["36"]= "lyMarginalie.html@@@Marginalie (marginalia)@@@Anmerkungen, Quellenhinweise, Kommentare o. ä. am Rand (Außensteg, selten am Bundsteg) von Seiten werden als Marginalien bezeichnet. Oft sind sie in abweichender Schriftart und -größe gesetzt. Im...";
fil["37"]= "lyMathematische_Zeichen.html@@@Mathematische Zeichen (MathsRegion)@@@Gleichungen, Formeln, mathematische Ausdrücke werden (auch wenn einzelne Zeichen darstellbar wären) nicht als Text erfasst, sondern als MathsRegion gekennzeichnet...";
fil["38"]= "lyNotenzeichen.html@@@Noten (MusicRegion)@@@Musiknotationen aller Art (historische, modern oder Neumen) werden als solche gekennzeichnet. Wenn bei Liedern Texte unterhalb von einzelnen Notensystemen stehen und eine klare Trennung erkennbar ist...";
fil["39"]= "lyRauschen.html@@@Schäden, Schmutz, Verfärbungen, Rauschen (NoiseRegion)@@@Schäden, Schmutz, Verfärbungen, Artefakte die durch verschiedene Faktoren (Beleuchtung, Spiegelungen, Scannen) hervorgerufen werden, sind mit der NoiseRegion zu kennzeichnen. Mit der Kennzeichnung...";
fil["40"]= "lySatzspiegel.html@@@Satzspiegel@@@Im Druckgewerbe wird die eigentlich nutzbare Fläche einer Buchseite (eigentliche einer Doppelseite) als Satzspiegel bezeichnet. Er ist mit Ausnahme von Titelblatt und mehrseitigen Bildern für alle...";
fil["41"]= "lySeitentypen.html@@@Erster Schritt : Die Seitentypen@@@Strukturell betrachtet besteht ein Buch aus verschiedenen Seitentypen. Die zu erfassenden Seiten sind auf Grundlage der definierten Typologie zu kennzeichnen. Seitentypen entsprechend des...";
fil["42"]= "lySeitenzahl.html@@@Seitenzahl (page-number)@@@Seitenzahlen werden als eigene Textregion behandelt und als Seitenzahl ausgezeichnet, egal wo sie sich auf der Seite befindet. Obwohl sie de facto ein toter Kolumnentitel ist, wird sie im Kontext der...";
fil["43"]= "lySeparatoren.html@@@Trennlinien, Separatoren (SeparatorRegion)@@@Werden verschiedene Text- oder Layoutbereiche voneinander durch Linien... getrennt, werden als Separatoren ausgezeichnet. Auch Vignetten oder kleinerer Buchschmuck können die Funktion von Separatoren...";
