fil["45"]= "lyTabellen.html@@@Tabellen (TableRegion)@@@Tabellen sind graphisch strukturierte Informationen, die in Spalten und Zeilen angeordnet wurden. Diese Anordnung kann durch Linien gekennzeichnet sein, jedoch ganz häufig fehlen diese Linien. In...";
fil["46"]= "lyTextregionen.html@@@Zweiter Schritt : Seitenregionen@@@Auf einer Seite befinden sich verschiedene strukturell sowie inhaltliche unterschiedliche Regionen. Nachdem der Satzspiegel bestimmt und ausgezeichnet wurde, wird das Layout analysiert. Hierbei sind...";
fil["47"]= "lyTypographie.html@@@Typographische Besonderheiten@@@Für alle Texte gelten die folgenden typographischen Auszeichnungswerte für das Attribut custom : Typographische Besonderheiten @custom Wert Beispiel Hinweise Fettdruck bold textStyle {offset:0...";
