fil["49"]= "lyWerbung.html@@@Werbung (AdvertRegion)@@@Werbung, Anzeigen, Reklame, Annonce, Inserate sind als AdvertRegion zu kennzeichnen. Innerhalb einer Anzeige können sich weitere Regionen befinden, die entsprechend ihrer strukturellen Bedeutung...";
fil["50"]= "ly_level_1_5.html@@@Level 1@@@Die minimale Erfassung des Ground-Truth beinhaltet: TextRegion ( Textregion ), ImageRegion ( Abbildungen, Fotos ), GraphicRegion ( Buchschmuck, Zeichnungen ), SeparatorRegion ( Trennlinien...";
