fil["335"]= "trSchreibweisen.html@@@Schreibweisen, spezielle Zeichen und Sonderzeichen@@@Die Texterfassung erfolgt grundsätzlich vorlagengetreu im Unicode-Format (Kodierung in UTF-8) des zum Zeitpunkt der Erfassung gültigen Unicode-Standards. Die Schreibung von Zeichen, die nicht auf...";
fil["336"]= "trSilbentrennung.html@@@Silbentrennung@@@Die Transkription der Silbentrennung erfolgt nach Vorlage. Dabei können beim Trennungszeichen unterschiedliche Varianten vorkommen. Die konkrete Transkription des Trennungsstriches wird in den jeweiligen Levels geregelt...";
fil["337"]= "trSonderzeichen.html@@@Zahlen@@@Zahlen im gedruckten Text können verschiedene Funktionen haben. So bei hochgestellten Zahlen können diese Referenzen in Form von Fuß- oder Endnoten darstellen. Aber auch mathematische Funktionen...";
fil["338"]= "trTabellen.html@@@Tabellen@@@Die Erfassung des Textes in Tabellen erfolgt grundsätzlich vorlagengetreu im Unicode-Format (Kodierung in UTF-8) des zum Zeitpunkt der Erfassung gültigen Unicode-Standards. Die Schreibung von Zeichen...";
