fil["340"]= "trZeichensetzung.html@@@Zeichensetzung@@@Alle Satzzeichen (Fragezeichen, Ausrufezeichen, Punkt, Komma, Semikolon, Doppelpunkt, Virgel) werden wie gedruckt erfasst. Auf eine Normalisierung der Zeichensetzung nach heutigen Standards wird...";
